import React, { Component } from "react";
import { connect } from "react-redux";
import { Modal } from "react-materialize";

function mapStateToProps(state) {
  return {};
}

class BusinessForm extends Component {
  render() {
    return (
      <div>
        <Modal
          actions={[
            <Button flat modal="close" node="button" waves="green">
              Close
            </Button>
          ]}
          bottomSheet={false}
          fixedFooter={false}
          header="Modal Header"
          id="modal-0"
          options={{
            dismissible: true,
            endingTop: "10%",
            inDuration: 250,
            onCloseEnd: null,
            onCloseStart: null,
            onOpenEnd: null,
            onOpenStart: null,
            opacity: 0.5,
            outDuration: 250,
            preventScrolling: true,
            startingTop: "4%"
          }}
          trigger={<Button node="button">MODAL</Button>}
        >
          <form>
            <h5>Create a new Business</h5>
            <Row>
              <TextInput
                s={12}
                l={6}
                m={6}
                xl={6}
                label="Name:"
                name="name"
                required
              />
              <TextInput
                s={12}
                l={6}
                m={6}
                xl={6}
                label="Address"
                name="address"
                required
              />
              <TextInput
                s={12}
                l={6}
                m={6}
                xl={6}
                label="Phone:"
                name="phone"
                required
              />
            </Row>
            <Row>
              <Button
                node="button"
                className="gradient-btn btn-primary"
                waves="green"
              >
                Create
              </Button>
            </Row>
          </form>
        </Modal>
      </div>
    );
  }
}

export default connect(mapStateToProps)(BusinessForm);
